import React from "react";

function Contact() {
  return (
    <div>
      <p>
        Feel free to contact me by email at{" "}
        <a href="mailto:longquanhp@gmail.com">longquanhp@gmail.com</a>!
      </p>
      <p>
        Or take a look at my <a href="https://github.com/n0pan">GitHub</a> and <a href="https://www.linkedin.com/in/longquanhp/">LinkedIn</a>!
      </p>
    </div>
  );
}

export default Contact;
